  false,\n\t\"url\": null,\n\t\"notes\": \"The project as described was to chemically
  treat invasive Phragmites (aka, common reed) along Lower Crab Creek within the MP31
  Fire area, to protect Burned Area Rehabilitation (BAR) treatments.  The MP31 Fire
  burned a portion of the Lower Crab Creek area in 2012; multiple integrated rehabilitation
  treatments were undertaken in response.  Phragmites had expanded into the burned
  area to an unforeseen degree, threatening the rehab treatments.  Phragmites is a
  highly aggressive invader that will form monocultures at the expense of native habitats.
  \ This invasion required an aggressive response to protect the substantial investment.
  \ BAR funding was no longer available for this response.\",\n\t\"license_title\":
